import React, { useEffect, useState } from 'react';

function UserListComp() {
    const [render, setRender] = useState([])
    let temp1 = []
    let temp2 = []

    const users = [
        {
          firstName: "John",
          lastName: "Smith",
          username: "john.smith@sample.com",
        },
        {
          firstName: "Sarah",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "3",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "3",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "4",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        }
    ];

    useEffect(() => {
        for(let i = 0; i < users.length % 4; i++){
            users.push({firstName: ""});
        };

        for(let i = 0; i < users.length / 4; i++){
            temp2 = []

            for(let j = 0; j < 4; j++){
                temp2.push(<div key = { (i + 1) * (j + 1) - 1 } className = 'col-md-3'>{users[(i + 1) * (j + 1) - 1].firstName}</div>);
            };
            temp1.push(<div key = {i} className = 'row'>{temp2}</div>)
        };

        setRender(temp1)
    }, [])

    return (
        <>
            { render }
        </>
    );
}

export default UserListComp;
